import React, { Component } from 'react'

const anime_art = [
    "https://66.media.tumblr.com/35cd8d3a5a350997ef3f7a71350efa9e/1ed772b41ffa92e6-2b/s500x750/48bae543cc99d3b468d7b52ec73687c7a4c32df4.gifv",
    "https://66.media.tumblr.com/78f09bedddd14cec03d38ddb457a4a85/tumblr_pjw3agT18z1xdjegyo1_540.gifv"
]

export default class LoFi extends Component {
    constructor() {

        super()
        this.state = {
            art: anime_art[Math.floor(Math.random()*anime_art.length)]
        }
    }
    render() {
        return (
            <div className="wrapper">
                <iframe className="player" width="20%" height="450" scrolling="no" frameborder="no" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/playlists/601710774&color=%239c5cba&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>
            </div>
        )
    }
}
